#include <iostream>
#include <thread>
#include <chrono>

int main() {
    std::cout << "Program zatrzyma się na 10 sekund..." << std::endl;

    // Zatrzymanie wykonania programu na 10 sekund
    std::this_thread::sleep_for(std::chrono::seconds(10));

    std::cout << "10 sekund minęło!" << std::endl;
    return 0;
}
